import React from "react";
import { Link } from 'react-router-dom';

import {changeState} from './Navbar';
import './App.css';

export default class Login extends React.Component{
    render(){
        return(
            <form id="login-form">
                <div class="mb-3">
                    <label class="form-label">Email address</label>
                    <input type="email" class="form-control" required></input>
                </div>
                <div class="mb-3">
                    <label for="inputPassword5" class="form-label">Password</label>
                    <input type="password" class="form-control" required></input>
                </div>
                <Link to="/"><button type="submit" class="btn btn-primary mx-auto d-block" onClick="">Login</button></Link>
            </form>
        )
    }
}
